import React from 'react'
import { Col, Dropdown, Menu } from 'antd'
import { Link } from 'react-router-dom';
import More from '../../assets/img/iconos/more_vert-24px.svg'

import './Simplecard.scss'


export default function Simplecard(props) {
            
    const { data } = props;
    
    const menu = (competencia , e) => {
        alert('hjhjh');


    }
    // const menu = (
    //     <Menu>
    //       <Menu.Item key="0">
    //         <Menu.Item key="3"><Link to="/miempresa-edit">Clonar equipo</Link></Menu.Item>
    //       </Menu.Item>
    //       <Menu.Item key="1">
    //         <Menu.Item key="1"><Link to="/miempresa-edit">Renombrar</Link></Menu.Item>
    //       </Menu.Item>
    //       <Menu.Item key="2">
    //         <Menu.Item key="1"><Link to="/miempresa-edit">Editar</Link></Menu.Item>
    //       </Menu.Item>
    //       <Menu.Divider />
    //       <Menu.Item key="1">
    //         <Menu.Item key="1"><Link to="/miempresa-edit">Eliminar</Link></Menu.Item>
    //       </Menu.Item>
    //     </Menu>
    //   );

    return (
       
            data.map((data,index) =>
                <div className="Simplecard" id={data.id} key={index}>
                        <Col className="gutter-row" span={22} >
                            <h5>{data.nombre}</h5>
                            <span>{data.subtitle}</span><br/>
                            <span>{data.fecha}</span>
                        </Col>
                        <Col className="gutter-row" span={2} >
                            <Dropdown overlay={(e) => menu(index,e)} trigger={['click']}>
                                <Link to="#" className="ant-dropdown-link" id={index} onClick={e => e.preventDefault()}><img alt="logo" src={More} width="25" height="25" /></Link>               
                            </Dropdown>
                        </Col>
                </div>  
            )
            
       
    )
}
